(1, 'ĐÔI NÉT VỀ VKSPA', 'about', NULL, 'https://www.youtube.com/embed/y65GocjN5RE?autoplay=1&loop=1&playlist=uI-_7eDbv_Q', NULL, '- Với đội ngũ nhân viên chuyên nghiệp cùng công nghệ tiên tiến - máy móc hiện đại được nhập khẩu từ Cộng Hòa Liên Bang Đức, VK SPA hân hạnh được phục vụ quý khách với niềm Đam Mê và tinh thần Trách Nhiệm Cao Nhất.\r\n- Chúng tôi mong muốn với bề dày kinh nghiệm của mình, VK SPA sẽ mang lại sự nét Trẻ - Khỏe - Đẹp từ bên trong đến hình thể bên ngoài trong từng chi tiết nhất.', '[{\"title\":\"UY T\\u00cdN\",\"content\":null,\"icon\":\".\\/uploads\\/abouts\\/icon1.png\"},{\"title\":\"T\\u1eacN T\\u00c2M PH\\u1ee4C V\\u1ee4\",\"content\":null,\"icon\":\".\\/uploads\\/abouts\\/icon2.png\"},{\"title\":\"CH\\u1ea4T L\\u01af\\u1ee2NG\",\"content\":null,\"icon\":\".\\/uploads\\/abouts\\/icon3.png\"}]', '2018-06-17 00:25:00', '2018-08-23 06:30:09');
