(6, 'Khóa học tiếng Hàn giao tiếp 1', 'KH6', 'khoa-hoc-tieng-han-giao-tiep-1', NULL, '<p>Khóa học tiếng Hàn giao tiếp 1<br></p>', '', 1, '2018-06-09 05:02:19', '2018-06-09 05:01:45', '2018-06-09 05:02:19', 'Khóa học tiếng Hàn giao tiếp 1', 'Khóa học tiếng Hàn giao tiếp 1', 'Khóa học tiếng Hàn giao tiếp 1', '/uploads/courses/khoa-hoc-tieng-han-giao-tiep-12018-06-09.jpg'),
(7, 'Khóa học tiếng Hàn giao tiếp 1', 'KH7', 'khoa-hoc-tieng-han-giao-tiep-1', 'Khóa học tiếng Hàn giao tiếp 1', '<p>Khóa học tiếng Hàn giao tiếp 1<br></p>', NULL, 1, '2018-06-15 02:38:43', '2018-06-09 05:02:14', '2018-06-15 02:38:43', 'Khóa học tiếng Hàn giao tiếp 1', NULL, 'Khóa học tiếng Hàn giao tiếp 1', '/uploads/courses/khoa-hoc-tieng-han-giao-tiep-12018-06-09.jpg'),
(8, 'SAP2000, ETABS và SAFE Phân tích và thiết kế kết cấu', 'KH8', 'sap2000-etabs-va-safe-phan-tich-va-thiet-ke-ket-cau', 'Phân tích và thiết kế kết cấu xây dựng sử dụng SAP2000, SAFE và ETABS (Analysis and design for civil structures using SAP2000, SAFE and ETABS)', '<p class=\"MsoNormal\" style=\"margin-right:5.65pt;text-align:justify\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Học\r\ngì và làm được gì sau khóa học: <o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:5.65pt;\r\nmargin-bottom:10.0pt;margin-left:26.35pt;text-align:justify;text-indent:-17.85pt;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Sau khóa học, học viên tự mình thực hành và\r\nsử dụng thành thạo 3 phần mềm;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:5.65pt;\r\nmargin-bottom:10.0pt;margin-left:26.35pt;text-align:justify;text-indent:-17.85pt;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;Phân\r\ntích và xử lý kết quả phân tích khi áp dụng cho các hệ kết cấu phẳng và không\r\ngian;<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Áp dụng phần mềm để thiết\r\nkế kết cấu Bê tông cốt thép và kết cấu thép theo tiêu chuẩn nước ngoài.</span><br></p>', '<p>THS. NGUYỄN TRUNG HIẾU</p><p>THS. NGUYỄN VĂN THÔNG</p>', 1, '2018-06-15 03:03:53', '2018-06-15 02:46:09', '2018-06-15 03:03:53', 'SAP2000, ETABS và SAFE', 'SAP2000, ETABS và SAFE', 'SAP2000, ETABS và SAFE', '/uploads/courses/sap2000-etabs-va-safe-phan-tich-va-thiet-ke-ket-cau2018-06-15.gif'),
(9, 'ETABS và SAFE Phân tích và thiết kế kết cấu Nâng cao', 'KH9', 'etabs-va-safe-phan-tich-va-thiet-ke-ket-cau-nang-cao', 'Phân tích và thiết kế kết cấu xây dựng sử dụng SAFE và ETABS Nâng cao (Analysis and design for civil structures using SAFE and ETABS: Advanced)', '<p class=\"MsoNormal\" style=\"margin-top:3.0pt;margin-right:0cm;margin-bottom:3.0pt;\r\nmargin-left:0cm;text-align:justify\"><span style=\"font-size:9.0pt;line-height:\r\n115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Giảng viên của HCT sẽ giúp bạn nâng\r\ncao kiến thức về 2 phần mềm, trao đổi dữ liệu giữa 2 phần mềm. Bạn sẽ được hướng\r\ndẫn vận dụng thực tế vào phân tích và thiết kế nhà cao tầng, các dạng sàn BTCT\r\nhay các loại móng như móng bè hay móng cọc …<o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:3.0pt;margin-right:0cm;margin-bottom:3.0pt;\r\nmargin-left:0cm;text-align:justify\"><span style=\"font-size:9.0pt;line-height:\r\n115%;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Khóa học phù hợp với học viên khối\r\nngành kỹ thuật xây dựng đã biết sử dụng các phần mềm SAFE và ETABS muốn học các\r\ntính năng nâng cao để thiết kế các công trình có kế cấu phức tạp đáp ứng nhu cầu\r\ncao của thực tế; Người đang làm thiết kế kết cấu công trình xây dựng muốn nâng\r\ncao kỹ năng và kiến thức trong việc áp dụng phần mềm vào thiết kế kết cấu.<o:p></o:p></span></p>', '<p>THS. NGUYỄN VĂN THÔNG</p><p>THS. NGUYỄN TRUNG HIẾU</p>', 1, '2018-06-15 03:02:30', '2018-06-15 03:00:29', '2018-06-15 03:02:30', 'ETABS và SAFE Phân tích và thiết kế kết cấu Nâng cao', NULL, NULL, NULL),
(10, 'ETABS và SAFE Phân tích và thiết kế kết cấu Nâng cao', 'KH10', 'etabs-va-safe-phan-tich-va-thiet-ke-ket-cau-nang-cao', 'Phân tích và thiết kế kết cấu xây dựng sử dụng SAFE và ETABS Nâng cao (Analysis and design for civil structures using SAFE and ETABS: Advanced)\r\nKhóa học cung cấp các kiến thức nâng cao về sử dụng phần mềm SAFE và ETABS để tính toán sàn phẳng, vách cứng, gió động và động đất… trong nhà cao tầng theo phương pháp đơn giản, dễ hiểu và tính ứng dụng cao. Sau khi hoàn thành khóa học, học viên có thể sử dụng các phần mềm này trong việc xây dựng mô hình tính toán để áp dụng trong thiết kế kết cấu các công trình cao tầng. Với xu hướng xây dựng nhà cao tầng hiện nay, khóa học phù hợp cho các bạn học viên khối ngành kỹ thuật xây dựng dân dụng và công nghiệp, kỹ sư xây dựng đã đi làm muốn nâng cao chuyên môn về phân tích và thiết kế kết cấu xây dựng nhà cao tầng.', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:9.0pt\">Giảng vi&ecirc;n của HCT sẽ gi&uacute;p bạn n&acirc;ng cao kiến thức về 2 phần mềm, trao đổi dữ liệu giữa 2 phần mềm. Bạn sẽ được hướng dẫn vận dụng thực tế v&agrave;o ph&acirc;n t&iacute;ch v&agrave; thiết kế nh&agrave; cao tầng, c&aacute;c dạng s&agrave;n BTCT hay c&aacute;c loại m&oacute;ng như m&oacute;ng b&egrave; hay m&oacute;ng cọc &hellip;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><span style=\"font-size:9.0pt\">Kh&oacute;a học ph&ugrave; hợp với học vi&ecirc;n khối ng&agrave;nh kỹ thuật x&acirc;y dựng đ&atilde; biết sử dụng c&aacute;c phần mềm SAFE v&agrave; ETABS muốn học c&aacute;c t&iacute;nh năng n&acirc;ng cao để thiết kế c&aacute;c c&ocirc;ng tr&igrave;nh c&oacute; kế cấu phức tạp đ&aacute;p ứng nhu cầu cao của thực tế; Người đang l&agrave;m thiết kế kết cấu c&ocirc;ng tr&igrave;nh x&acirc;y dựng muốn n&acirc;ng cao kỹ năng v&agrave; kiến thức trong việc &aacute;p dụng phần mềm v&agrave;o thiết kế kết cấu.</span></p>', '<p>THS. NGUYỄN VĂN TH&Ocirc;NG</p>\r\n\r\n<p>THS. NGUY&Ecirc;N TRUNG HIẾU</p>', 1, NULL, '2018-06-15 03:03:35', '2018-06-19 09:17:53', 'ETABS và SAFE Phân tích và thiết kế kết cấu Nâng cao', NULL, 'ETABS và SAFE Phân tích và thiết kế kết cấu Nâng cao', '/uploads/courses/etabs-va-safe-phan-tich-va-thiet-ke-ket-cau-nang-cao2018-06-15.jpg'),
(11, 'SAP2000, ETABS và SAFE Phân tích và thiết kế kết cấu', 'KH11', 'sap2000-etabs-va-safe-phan-tich-va-thiet-ke-ket-cau', 'Phân tích và thiết kế kết cấu xây dựng sử dụng SAP2000, SAFE và ETABS (Analysis and design for civil structures using SAP2000, SAFE and ETABS)\r\nTham gia khóa học, học viên sẽ được giảng viên hướng dẫn cách sử dụng bộ ba phần mềm SAP2000, ETABS và SAFE bao gồm các kỹ năng phân tích kết cấu và những thủ thuật mô hình kết cấu nhanh và chính xác để xác định nội lực, biến dạng, ứng suất… của các cấu kiện trong mô hình sát với sự làm việc thực tế của kết cấu. Sau khi hoàn thành khóa học, học viên có thể sử dụng các phần mềm này trong việc xây dựng mô hình tính toán để áp dụng trong quá trình học tập và công việc. Ngoài ra học viên còn được học và ôn luyện các kiến thức về Bê tông cốt thép liên quan trong quá trình mô hình các bài toán thực hành. Khóa học phù hợp cho các bạn học viên khối ngành kỹ thuật, kinh tế xây dựng, kỹ sư xây dựng đã đi làm muốn nâng cao chuyên môn về phân tích và thiết kế kết cấu xây dựng.', '<p style=\"margin-right:5.65pt; text-align:justify\"><span style=\"font-size:10.0pt\">Học g&igrave; v&agrave; l&agrave;m được g&igrave; sau kh&oacute;a học: </span></p>\r\n\r\n<p style=\"margin-left:26.35pt; margin-right:5.65pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:10.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:10.0pt\">Sau kh&oacute;a học, học vi&ecirc;n tự m&igrave;nh thực h&agrave;nh v&agrave; sử dụng th&agrave;nh thạo 3 phần mềm;</span></p>\r\n\r\n<p style=\"margin-left:26.35pt; margin-right:5.65pt; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:10.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:10.0pt\">&nbsp;Ph&acirc;n t&iacute;ch v&agrave; xử l&yacute; kết quả ph&acirc;n t&iacute;ch khi &aacute;p dụng cho c&aacute;c hệ kết cấu phẳng v&agrave; kh&ocirc;ng gian;</span></p>\r\n\r\n<p><span style=\"font-size:10.0pt\">&Aacute;p dụng phần mềm để thiết kế kết cấu B&ecirc; t&ocirc;ng cốt th&eacute;p v&agrave; kết cấu th&eacute;p theo ti&ecirc;u chuẩn nước ngo&agrave;i.</span></p>', '<p>THS. NGUYỄN TRUNG HIẾU</p>\r\n\r\n<p>THS. NGUYỄN VĂN TH&Ocirc;NG</p>', 1, NULL, '2018-06-15 03:05:21', '2018-06-19 09:18:24', 'SAP2000, ETABS và SAFE Phân tích và thiết kế kết cấu', NULL, 'SAP2000, ETABS và SAFE Phân tích và thiết kế kết cấu', '/uploads/courses/sap2000-etabs-va-safe-phan-tich-va-thiet-ke-ket-cau2018-06-15.gif'),
(12, 'Lập tiến độ và quản lý dự án xây dựng bằng Microsoft Project', 'KH12', 'lap-tien-do-va-quan-ly-du-an-xay-dung-bang-microsoft-project', 'Lập tiến độ và quản lý xây dựng bằng Microsoft Project  \r\n(Scheduling and construction management using Microsoft Project)\r\nKhóa học cung cấp cho bạn những kiến thức thực tế về quản lý dự án, hiểu cách thức tổ chức công việc, quản lý được tài nguyên và chi phí cho một dự án, giúp bạn theo dõi tiến độ của dự án cũng như cách thức sử dụng phần mềm Microsoft Project để quản lý dự án. Sau khóa học học viên sẽ tự tin tự mình lập kế hoạch, phân phối và sử dụng tài nguyên, theo dõi và cập nhật tiến độ dự án.\r\nKhóa học phù hợp với học viên từ năm 3 các khối ngành kỹ thuật xây dựng, công trình giao thông, kiến trúc, quản lý xây dựng, kinh tế xây dựng;… Các cá nhân đang làm công tác quản lý dự án, lập tiến độ quản lý dự án, thi công các công trình dân dụng và công nghiệp', '<p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:0cm;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><b><span lang=\"VI\" style=\"mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Mô tả chung môn\r\nhọc (Course Description):</span></b><b><span lang=\"VI\" style=\"font-size:16.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nVI\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:6.0pt;\r\nmargin-left:17.0pt;text-align:justify;line-height:normal\"><i><span lang=\"VI\" style=\"font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Khóa\r\nhọc MS Project bao gồm 8 buổi học thực hành trên máy tính, mỗi buổi có thời lượng\r\n<span style=\"background:yellow;mso-highlight:yellow\">180</span> phút. Khóa học\r\nsẽ dạy học viên cách sử dụng phần mềm MS Project để quản lý dự án nói chung và dự\r\nán xây dựng nói riêng. Khóa học cung cấp cho sinh viên những kiến thức căn bản\r\nvề quản lý dự án, hiểu cách thức tổ chức công việ; thế nào là quản lý tài\r\nnguyên và chi phí cho một dự án và làm sao để theo dõi tiến độ của dự án. Thông\r\nqua bài giảng, bài tập cá nhân học viên sẽ thực hành với việc lập kế hoạch,\r\nphân phối và sử dụng tài nguyên, theo dõi và cập nhật tiến độ dự án.<o:p></o:p></span></i></p><p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:0cm;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><b><span lang=\"VI\" style=\"mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Yêu cầu khóa học\r\n(Course Requirement):<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:17.85pt;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><span lang=\"VI\" style=\"font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Học viên được\r\ncấp chứng nhận khi đủ các điều kiện:<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:46.2pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-17.85pt;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"VI\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;mso-ansi-language:VI\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"VI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Học viên được yêu cầu\r\ndự ít nhất 5/8 buổi;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:46.2pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-17.85pt;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"VI\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;mso-ansi-language:VI\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"VI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Đạt từ 5.0 điểm trở\r\nlên của bài thi cuối khóa.<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:0cm;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><b><span style=\"mso-bidi-font-size:14.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Cách đánh giá khóa học (Course Assessment):</span></b><b><span style=\"font-size:16.0pt;font-family:\r\n&quot;Calibri&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:17.85pt;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nEN-US\">Học viên phải làm bài thi thực hành trên máy tính, thời gian <span style=\"background:yellow;mso-highlight:yellow\">120</span> phút để kiểm tra các\r\nkiến thức và các kỹ năng đã học trong 8 buổi trước đó; Điểm đạt </span><span style=\"font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:Calibri;\r\nmso-hansi-font-family:Calibri;mso-bidi-font-family:Calibri;mso-ansi-language:\r\nEN-US;mso-char-type:symbol;mso-symbol-font-family:Symbol\">³</span><span style=\"font-size:1