(13, 'Lập tiến độ và quản lý dự án xây dựng bằng Microsoft Project', 'KH13', 'lap-tien-do-va-quan-ly-du-an-xay-dung-bang-microsoft-project', 'Lập tiến độ và quản lý xây dựng bằng Microsoft Project  \r\n(Scheduling and construction management using Microsoft Project)\r\nKhóa học cung cấp cho bạn những kiến thức thực tế về quản lý dự án, hiểu cách thức tổ chức công việc, quản lý được tài nguyên và chi phí cho một dự án, giúp bạn theo dõi tiến độ của dự án cũng như cách thức sử dụng phần mềm Microsoft Project để quản lý dự án. Sau khóa học học viên sẽ tự tin tự mình lập kế hoạch, phân phối và sử dụng tài nguyên, theo dõi và cập nhật tiến độ dự án.\r\nKhóa học phù hợp với học viên từ năm 3 các khối ngành kỹ thuật xây dựng, công trình giao thông, kiến trúc, quản lý xây dựng, kinh tế xây dựng;… Các cá nhân đang làm công tác quản lý dự án, lập tiến độ quản lý dự án, thi công các công trình dân dụng và công nghiệp', '<p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:0cm;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><b><span lang=\"VI\" style=\"mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Mô tả chung môn\r\nhọc (Course Description):</span></b><b><span lang=\"VI\" style=\"font-size:16.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:\r\nVI\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:6.0pt;\r\nmargin-left:17.0pt;text-align:justify;line-height:normal\"><i><span lang=\"VI\" style=\"font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Khóa\r\nhọc MS Project bao gồm 8 buổi học thực hành trên máy tính, mỗi buổi có thời lượng\r\n<span style=\"background:yellow;mso-highlight:yellow\">180</span> phút. Khóa học\r\nsẽ dạy học viên cách sử dụng phần mềm MS Project để quản lý dự án nói chung và dự\r\nán xây dựng nói riêng. Khóa học cung cấp cho sinh viên những kiến thức căn bản\r\nvề quản lý dự án, hiểu cách thức tổ chức công việ; thế nào là quản lý tài\r\nnguyên và chi phí cho một dự án và làm sao để theo dõi tiến độ của dự án. Thông\r\nqua bài giảng, bài tập cá nhân học viên sẽ thực hành với việc lập kế hoạch,\r\nphân phối và sử dụng tài nguyên, theo dõi và cập nhật tiến độ dự án.<o:p></o:p></span></i></p><p class=\"MsoListParagraph\" style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:0cm;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><b><span lang=\"VI\" style=\"mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Yêu cầu khóa học\r\n(Course Requirement):<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:17.85pt;margin-bottom:.0001pt;text-align:justify;line-height:normal\"><span lang=\"VI\" style=\"font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Học viên được\r\ncấp chứng nhận khi đủ các điều kiện:<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:46.2pt;margin-bottom:.0001pt;text-align:justify;text-indent:\r\n-17.85pt;line-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"VI\" style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;mso-ansi-language:VI\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"VI\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ansi-language:VI\">Học viên được yêu cầu\r\ndự ít nhất 5/8 buổi;<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right