INSERT INTO `homes` (`id`, `title`, `slug`, `image`, `content`, `slogan`, `multi_image`, `created_at`, `updated_at`) VALUES
(1, 'DRIVE YOU TO SUCCESS', 'DRIVE_YOU_TO_SUCCESS', './uploads/homes/drive-you-to-success2018-06-03.png', '<h3 class=\"text-rotater font-secondary\" style=\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" line-height:=\"\" 1.7;=\"\" color:=\"\" rgb(136,=\"\" 136,=\"\" 136);=\"\" font-size:=\"\" 20px;\"=\"\"><p class=\"MsoNormal\" style=\"text-align: justify; \"><span style=\"font-size: 18px;\">Bạn học ngành <b>xây dựng</b> nhưng không có nhiều cơ hội\r\nthực hành những kiến thức đã học? Bạn chưa tự tin với những kiến thức được trang bị\r\ntại trường?</span><o:p></o:p></p><span style=\"font-size: 18px;\">\r\n\r\n</span><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 18px;\">Bạn muốn cải thiện kỹ năng nhưng chưa tìm được trung tâm đào\r\ntạo có cơ sở vật chất hiện đại, giảng viên chuyên môn cao, không gian học tập\r\nsáng tạo mà mức học phí lại phù hợp?</span><o:p></o:p></p><span style=\"font-size: 18px;\">\r\n\r\n</span><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 18px;\">Tiếng Anh chuyên ngành xây dựng là một lợi thế để ứng tuyển\r\nvào các công ty có mức lượng cao. Bạn đã sẵn sàng chưa?</span><o:p></o:p></p><span style=\"font-size: 18px;\">\r\n\r\n</span><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 18px;\">HCT sẽ giúp bạn!</span><o:p></o:p></p></h3>', '', NULL, '2018-05-27 07:08:24', '2018-06-22 03:13:42'),
(2, 'NHỮNG LỢI ÍCH CHÚNG TÔI MANG ĐẾN CHO BẠN copy', 'LOI_IT_CHUNG_TOI_MANG_DEN_CHO_BAN', NULL, NULL, 'Thành viên HCT có lợi ích gì?', NULL, '2018-05-27 07:08:25', '2018-05-27 07:08:25'),
(3, 'Tin Mới Cập Nhật', 'BLOG', NULL, NULL, 'Theo Dõi Chúng Tôi - Nhận Nhiều Ưu Đãi Giá Trị Hấp Dẫn', NULL, '2018-05-27 07:08:25', '2018-08-22 02:28:29'),
(4, 'NGƯỜI TRONG CUỘC NÓI GÌ VỀ HCT?', 'SPEAK_OF_HCT', NULL, NULL, '', NULL, '2018-05-27 07:08:25', '2018-05-27 07:08:25'),
(5, 'Khuyến Mãi Lớn Ngày Khai Trương', 'SPECIAL', NULL, NULL, 'Sale Off 50% - Duyên dáng hơn - Tươi trẻ hơn với VKSPA', NULL, '2018-06-17 00:25:49', '2018-08-22 02:07:06'),
