INSERT INTO `posts` (`id`, `name`, `slug`, `category_id`, `sort_order`, `author_id`, `status`, `sumary`, `content`, `number_view`, `image`, `post_tag`, `start_display`, `end_display`, `meta_title`, `meta_keyworks`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(2, 'Tuyển nhân viên bảo vệ', 'tuyen-nhan-vien-bao-ve', 9, 0, 4, 1, NULL, '<p>Để chuẩn bị khai trương chi nh&aacute;nh tại số <strong>71, đường D5, F. 25, Q. B&igrave;nh Thạnh, TP. Hồ Ch&iacute; Minh</strong>, <strong>C&ocirc;ng ty CP Kỹ thuật x&acirc;y dựng HCT (HCT CEN) </strong>đăng tuyển 02 nh&acirc;n vi&ecirc;n bảo vệ</p>\r\n\r\n<p>Y&ecirc;u cầu: Nam (tuổi từ 18-50), c&oacute; sức khỏe tốt, l&agrave;m việc theo ca</p>\r\n\r\n<p>Chế độ lương: <strong>Lương</strong> (Theo thỏa thuận)</p>\r\n\r\n<p><u><strong>Hồ Sơ ứng tuyển gồm:</strong></u></p>\r\n\r\n<p>1/ Giấy CMND C&ocirc;ng chứng</p>\r\n\r\n<p>2/ Đơn xin việc (k&egrave;m mức lương mong muốn)</p>\r\n\r\n<p>3/ Sơ yếu l&iacute; lịch.</p>\r\n\r\n<p>4/ Giấy kh&aacute;m sức khỏe</p>\r\n\r\n<p>File hồ sơ gửi về: <strong>info@hctcom.vn</strong>, bản in nộp k&egrave;m khi đi phỏng vấn.</p>\r\n\r\n<p>Mọi chi tiết vui l&ograve;ng li&ecirc;n hệ <strong>Mr. Hiệp (0919.430.990)</strong></p>', 0, '/uploads/posts/giao-vien-tieng-han-giao-tiep2018-06-03.jpg', 'Tuyển nhân viên bảo vệ', '2018-06-29 17:00:00', NULL, 'Tuyển nhân viên bảo vệ', 'Tuyển nhân viên bảo vệ', 'Tuyển nhân viên bảo vệ', NULL, '2018-06-02 05:17:14', '2018-06-18 08:32:20'),
(4, 'Tuyển giảng viên đào tạo nghiệp vụ XD', 'tuyen-giang-vien-dao-tao-nghiep-vu-xd', 9, 0, 4, 1, NULL, '<p><strong><span style=\"font-size:14px\">T<span style=\"font-family:arial,helvetica,sans-serif\">rung t&acirc;m đ&agrave;o tạo thực h&agrave;nh Kỹ thuật x&acirc;y dựng HCT cần tuyển</span></span></strong></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Giảng vi&ecirc;n giảng dạy thực h&agrave;nh c&aacute;c kh&oacute;a&nbsp;nghiệp vụ x&acirc;y dựng ngắn hạn như:</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">1/ Thiết kế bản vẽ bằng AutoCAD.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">2/ Ph&acirc;n t&iacute;ch v&agrave; thiết kế kết cấu bằng SAP2000, ETABS v&agrave; SAFE.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">3/ Ph&acirc;n t&iacute;ch v&agrave; thiết kế kết cấu bằng ETABS v&agrave; SAFE: N&acirc;ng cao</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">4/ Lập tiến độ v&agrave; quản l&yacute; dự &aacute;n x&acirc;y dựng bằng Microsoft Project.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">5/ Đọc, hiểu v&agrave; triển khai bản vẽ kỹ thuật x&acirc;y dựng.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">6/ Đo, b&oacute;c khối lượng v&agrave; lập dự to&aacute;n x&acirc;y dựng.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">7/ Thực h&agrave;nh thiết kế kết cấu c&ocirc;ng tr&igrave;nh x&acirc;y dựng</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">.................................................................................</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Y&ecirc;u cầu giảng vi&ecirc;n c&oacute; kinh nghiệm l&agrave;m việc thực tế, c&oacute; kinh nghiệm&nbsp;giảng dạy từ 03 năm trở l&ecirc;n, tận t&acirc;m, nhiệt t&igrave;nh, sẵn s&agrave;ng hổ trợ học vi&ecirc;n ngo&agrave;i giờ giảng tr&ecirc;n lớp để học vi&ecirc;n tiến bộ nhanh nhất.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\"><u><strong>Hồ Sơ ứng tuyển gồm:</strong></u></span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">1/ Giấy CMND C&ocirc;ng chứng</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">2/ Đơn xin việc (k&egrave;m thứ tự ưu ti&ecirc;n c&aacute;c m&ocirc;n&nbsp;c&oacute; thể giảng dạy)</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">3/ Sơ yếu l&iacute; lịch.</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">4/ Bản sao c&oacute; c&ocirc;ng chứng c&aacute;c văn bằng, chứng chỉ li&ecirc;n quan</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">5/ Giấy giới thiệu (nếu c&oacute;)</span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">File hồ sơ gửi về: <strong>info@hctcom.vn</strong>, bản in gửi về văn ph&ograve;ng c&ocirc;ng ty (<strong>số</strong> <strong>71, đường D5, F. 25, Q. B&igrave;nh Thạnh, TP. Hồ Ch&iacute; Minh)</strong></span></span></p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Mọi chi tiết vui l&ograve;ng li&ecirc;n hệ <strong>Mr. Hiệp (0919.430.990)</strong></span></span></p>', 0, '/uploads/posts/tuyen-dung-giao-vien-autocard2018-06-03.jpg', 'Tuyển giảng viên đào tạo nghiệp vụ XD', '2018-06-29 17:00:00', NULL, 'Tuyển giảng viên đào tạo nghiệp vụ XD', 'Tuyển giảng viên đào tạo nghiệp vụ XD', 'Tuyển giảng viên đào tạo nghiệp vụ XD', NULL, '2018-06-02 05:33:32', '2018-06-18 08:32:13'),
(5, 'Tuyển nhân viên làm việc tại HCT', 'tuyen-nhan-vien-lam-viec-tai-hct', NULL, 0, 4, 1, NULL, '<p>Để chuẩn bị khai trương chi nh&aacute;nh tại số <strong>71, đường D5, F. 25, Q. B&igrave;nh Thạnh, TP. Hồ Ch&iacute; Minh</strong>, <strong>C&ocirc;ng ty CP Kỹ thuật x&acirc;y dựng HCT (HCT CEN) </strong>đăng tuyển một số vị tr&iacute; như sau:</p>\r\n\r\n<p><u><strong>Vị tr&iacute;:</strong></u></p>\r\n\r\n<p>1/ Nh&acirc;n vi&ecirc;n văn ph&ograve;ng: số lượng 03, l&agrave;m việc to&agrave;n thời gian hoặc theo ca (ưu ti&ecirc;n nữ)</p>\r\n\r\n<p>2/ Cộng t&aacute;c vi&ecirc;n truyền th&ocirc;ng v&agrave; sự kiện, l&agrave;m việc b&aacute;n thời gian (ưu ti&ecirc;n&nbsp;sinh vi&ecirc;n học c&aacute;c ng&agrave;nh x&acirc;y dựng, kinh tế x&acirc;y dựng, quản l&yacute; x&acirc;y dựng ...</p>\r\n\r\n<p>Chế độ lương: <strong>Lương</strong> (Theo thỏa thuận) + <strong>Thưởng</strong></p>\r\n\r\n<p><u><strong>Hồ Sơ ứng tuyển gồm:</strong></u></p>\r\n\r\n<p>1/ Giấy CMND C&ocirc;ng chứng</p>\r\n\r\n<p>2/ Đơn xin việc (k&egrave;m mức lương mong muốn)</p>\r\n\r\n<p>3/ Sơ yếu l&iacute; lịch.</p>\r\n\r\n<p>File hồ sơ gửi về: <strong>info@hctcom.vn</strong>, bản in nộp k&egrave;m khi đi phỏng vấn.</p>\r\n\r\n<p>Mọi chi tiết vui l&ograve;ng li&ecirc;n hệ <strong>Mr. Hiệp (0919.430.990)</strong></p>', 0, '/uploads/posts/giao-vien-tieng-nhat2018-06-02.jpg', 'Tuyển nhân viên làm việc tại HCT', '2018-06-01 17:00:00', NULL, 'Tuyển nhân viên làm việc tại HCT', 'Tuyển nhân viên làm việc tại HCT', 'Tuyển nhân viên làm việc tại HCT', NULL, '2018-06-02 05:36:44', '2018-06-18 08:32:04'),
(6, 'Cho thuê phòng đào tạo (10 người)', 'cho-thue-phong-hop-dao-tao-10-nguoi', NULL, 0, 4, 1, NULL, '<ul>\r\n	<li>Ph&ograve;ng họp: 200.000đ/giờ</li>\r\n	<li>Gi&aacute; ưu đ&atilde;i cho học vi&ecirc;n HCT: 150.000đ/giờ</li>\r\n	<li>Hổ trợ m&agrave;n h&igrave;nh TV LG full HD 55in</li>\r\n	<li>Free m&aacute;y lạnh</li>\r\n</ul>', 0, '/uploads/images/posts/Phong%2010N%201280x720.jpg', 'Cho thuê phòng đào tạo số lượng 10 người', '2018-06-11 17:00:00', NULL, 'Cho thuê phòng đào tạo số lượng 10 người', 'Cho thuê phòng đào tạo số lượng 10 người', 'Cho thuê phòng đào tạo số lượng 10 người', NULL, '2018-06-12 13:16:32', '2018-06-20 06:37:43'),
(7, 'Cho thuê phòng đào tạo (15 người)', 'cho-thue-phong-hop-dao-tao-15-nguoi', NULL, 0, 4, 1, NULL, '<ul>\r\n	<li>Ph&ograve;ng họp: 250.000đ/giờ</li>\r\n	<li>Gi&aacute; ưu đ&atilde;i cho học vi&ecirc;n HCT: 200.000đ/giờ</li>\r\n	<li>Hổ trợ m&agrave;n h&igrave;nh TV LG full HD 65in</li>\r\n	<li>Free m&aacute;y lạnh</li>\r\n</ul>', 0, '/uploads/images/posts/Phong%2015N%201280x720.jpg', 'Cho thuê phòng đào tạo số lượng 15 người', '2018-06-11 17:00:00', NULL, 'Cho thuê phòng đào tạo số lượng 15 người', 'Cho thuê phòng đào tạo số lượng 15 người', 'Cho thuê phòng đào tạo số lượng 15 người', NULL, '2018-06-12 13:33:19', '2018-06-20 06:37:28'),
(8, 'Cho thuê phòng đào tạo (20 người)', 'cho-thue-phong-hop-dao-tao-20-nguoi', NULL, 0, 4, 1, NULL, '<ul>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Ph&ograve;ng họp: 300.000đ/giờ</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Gi&aacute; ưu đ&atilde;i cho học vi&ecirc;n HCT: 250.000đ/giờ</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Hổ trợ m&agrave;n h&igrave;nh TV LG full HD 65in</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Free m&aacute;y lạnh</span></span></li>\r\n</ul>', 0, '/uploads/images/posts/Phong%2020N%201280x720.jpg', 'Cho thuê phòng đào tạo số lượng 20 người', '2018-06-11 17:00:00', NULL, 'Cho thuê phòng đào tạo số lượng 20 người', 'Cho thuê phòng đào tạo số lượng 20 người', 'Cho thuê phòng đào tạo số lượng 20 người', NULL, '2018-06-12 13:39:07', '2018-06-20 06:37:13'),
(9, 'Đào tạo thực hành xây dựng', 'dao-tao-thuc-hanh-xay-dung', NULL, 0, 4, 1, NULL, '<p><strong><span style=\"font-family:calibri,sans-serif; font-size:13pt\">TRUNG T&Acirc;M Đ&Agrave;O TẠO - THỰC H&Agrave;NH KỸ THUẬT X&Acirc;Y DỰNG HCT</span></strong><span style=\"font-family:calibri,sans-serif; font-size:13pt\"> (vi&ecirc;t tắt: HCT-CEPT) l&agrave; th&agrave;nh vi&ecirc;n của C&ocirc;ng ty Cổ phần Kỹ thuật X&acirc;y dựng HCT được th&agrave;nh lập với vai tr&ograve; l&agrave; nơi đ&agrave;o tạo nguồn nh&acirc;n lực chất lượng cao để phục vụ cho nhu cầu trong lĩnh vực x&acirc;y dựng. HCT-CEPT cung cấp c&aacute;c lớp ngắn hạn về đ&agrave;o tạo kiến thức v&agrave; kỹ năng cần thiết nhằm ho&agrave;n thiện ở mức cao nhất m&agrave; nhu cầu của c&aacute;c doanh nghiệp x&acirc;y dựng hiện nay đang cần</span><span style=\"font-family:calibri,sans-serif; font-size:12pt\">.</span></p>', 0, '/uploads/posts/dao-tao-thuc-hanh-xay-dung2018-06-17.jpg', 'Đào tạo thực hành xây dựng', '2018-06-16 17:00:00', NULL, 'Đào tạo thực hành xây dựng', 'Đào tạo thực hành xây dựng', 'Đào tạo thực hành xây dựng', NULL, '2018-06-17 02:46:28', '2018-06-18 06:56:41'),
